import React from 'react';

function Square(props) {
  const winningSquareStyle = {
    backgroundColor: 'yellow'
  };
  return (
    <button
      className="square "
      style={props.winningSquare ? winningSquareStyle : null}
      onClick={props.onClick}
    >
      {props.value}
    </button>
  );
}

export default Square;
